import logo from './logo.svg';
import './App.css';
import pic from './profilePic.jpg';

function App() {
  console.log(pic);
  console.log("dfs");
  return (
    <div className="App">
      <header className="App-header">
        <img src={pic} className="Profile-pic" alt="profile pic" width="20%" height="100%"></img>
        <p>
          Hi there!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>  
      </header>
    </div>
  );
}

export default App;
